import React from 'react';
import './FeatureButtonStyle.scss';

class FeatureButton extends React.Component <any, any> {
    constructor(props: {title: string, clickAction: any;}) {
      super(props);
      this.state = {
          title: props.title,
          clickAction: props.clickAction
        }
    }
    render(){
        return (
            <div className="feature-button" onClick={this.state.clickAction}>
                <div className="feature-button-title">{this.state.title}</div>
            </div>
        );
    }
}
export default FeatureButton;
